import React, { Component } from 'react';

import '../index.css';
import './App.css';

class App extends Component {
  constructor() {
    super()
    this.state = {
      page: 'Introduction',
      isWaiting: true
    }
  }

  componentDidMount() {
    setTimeout(() => {
      this.setState({ isWaiting: false })
    }, 3000)
  }

  render() {
    if (this.state.isWaiting === true) {
      setTimeout(() => this.setState({ isWaiting: false }), 10000)
      return <button> </button>
    }
    else return <div>

      <div className = "svg-container"> 
        <svg viewBox="0 0 500 500">
          <path d = "M0,50 C150,200 350,0 500,100 L500,00 L0,0 Z" fill = 'rgb(50, 153, 71)'> </path>
        </svg>
      </div>

      {/* <div className = 'avatar'> </div> */}

    </div>
  }
}

export default App;
